import React from 'react';
import '../index';
import { IoLogoFacebook, IoLogoInstagram, IoMdMail, IoLogoWhatsapp } from "react-icons/io";

const Links = () => (
  <div className="bottom-layout">
    <a href="https://api.whatsapp.com/send?phone=6285364368226" target="black"><IoLogoWhatsapp/></a>
    <a href="https://www.facebook.com/thegeanfu" target="blank"><IoLogoFacebook/></a>
    <a href="https://www.instagram.com/sajaksenja_2019" target="blank"><IoLogoInstagram/></a>
    <a href="mailto:pecintasenja17@gmail.com"><IoMdMail/></a>
  </div>
);

export default Links;
